import spacelogo from "./images/spacelogo.png";
import react, { useEffect } from "react";
import "./App.css";
import Aboutme from "./components/Aboutme";
import { Router } from "express";

function App() {
  return (
    <>
      <Router>
        <switch>
          <Route path="/" exact component={Aboutme} />
        </switch>
      </Router>
    </>
  );
}

export default App;
